window.bookSummaryJSON = "<p><i>Rich Dad Poor Dad</i> is the #1 personal finance book of all time. Listen today to set yourself up for a wealthy, happy future.</p> <p>Robert Kiyosaki’s easy tips and straight talk will…</p> <p></p> <ul> <li>Explode the myth that you need to earn a high income to become rich</li> <li>Challenge the belief that your house is an asset</li> <li>Define once and for all an asset and a liability</li> <li>Show parents why they can’t rely on the school system to educate kids about money</li> <li>Clearly lay out what to teach kids about money for their future financial success</li> </ul> <p>With an incredible number of 5-star reviews, <i>Rich Dad Poor Dad</i> has challenged and changed the way tens of millions of people around the world think about money. With perspectives that often contradict conventional wisdom, Kiyosaki has earned a reputation for irreverence and courage. He is regarded worldwide as a passionate advocate for financial education. His easy-to-understand audiobook empowers you to make changes now - and enjoy the results for years to come.</p> <p>\"The main reason people struggle financially is because they have spent years in school but learned nothing about money. The result is that people learn to work for money… but never learn to have money work for them.\"<br> --Robert Kiyosaki <i>Rich Dad Poor Dad</i> - The #1 Personal Finance Book of All Time!</p> <p>“<i>Rich Dad Poor Dad</i> is a starting point for anyone looking to gain control of their financial future.” <br> --<i>USA Today</i></p>"; 
